dropAllTables = '''DROP TABLE games;
DROP TABLE lists;
DROP TABLE related;
VACUUM;
'''

createDB = '''CREATE TABLE IF NOT EXISTS games (
		game text NOT NULL,
		source integer
	);
	CREATE TABLE IF NOT EXISTS lists (
			list text,
			value text
	);
	CREATE TABLE IF NOT EXISTS related(
		gameID Integer,
		listID Integer,
		value Text
	);
	CREATE INDEX gameID_Idx on related(gameID);
	CREATE INDEX listID_Idx on related(listID);
	CREATE INDEX list_Idx on lists(list); 
	CREATE INDEX relatedVal on related(value);
'''

getGamesBtwPlayers = '''SELECT count(game)
FROM games
JOIN lists ON lists.rowid = games.source 
WHERE games.rowid
IN (
	SELECT gameID
	FROM related
	join lists ON lists.rowid = related.listID
	WHERE 
		(related.value GLOB 'Fischer, R.*' and lists.value = 'Black') or
		(related.value GLOB 'Fischer, R.*' and lists.value = 'White')
INTERSECT
	SELECT gameID
	FROM related
	join lists ON lists.rowid=related.listID
	WHERE
		(related.value GLOB 'Spassky, B.*' and lists.value = 'Black') or
		(related.value GLOB 'Spassky, B.*' and lists.value = 'White')
)'''

dbExists = '''SELECT count(name) FROM sqlite_master WHERE type='table' '''
insertGame = "INSERT INTO games (game, source) VALUES (?,?)"
insertHeaders = "INSERT INTO lists (list, value) VALUES ('headers', ?)"
insertSources = "INSERT INTO lists (list, value) VALUES('sources', ?)"
insertRelatedHeaders = "INSERT INTO related (gameID, listID, value) VALUES (?, ?, ?)"
getHeaders = "SELECT rowid, value FROM lists WHERE list='headers'"
getSources = "SELECT rowid, value FROM lists WHERE list='sources'"

